import { Tabs, Tab } from "react-bootstrap";
import "./Topbar.css";
import "bootstrap/dist/css/bootstrap.min.css";
import PersonOutlinedIcon from "@mui/icons-material/PersonOutlined";
import CalendarTodayOutlinedIcon from "@mui/icons-material/CalendarTodayOutlined";
import HelpOutlineOutlinedIcon from "@mui/icons-material/HelpOutline";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

const TopbarTabs = ({ location }) => {
  return (
    <Tabs
      defaultActiveKey="/home"
      id="uncontrolled-tab-example"
      className="mb-3"
      activeKey={location.pathname}
    >
      <Tab
        eventKey="/home"
        title={
          <Link
            to="/home"
            className={`tab-link ${
              location.pathname === "/home" ? "active" : ""
            }`}
          >
            <HelpOutlineOutlinedIcon
              style={{ verticalAlign: "middle", marginRight: "5px" }}
            />
            Main Page
          </Link>
        }
        className="home"
      />
      <Tab
        eventKey="/profile"
        title={
          <Link
            to="/profile"
            className={`tab-link ${
              location.pathname === "/profile" ? "active" : ""
            }`}
          >
            <PersonOutlinedIcon
              style={{ verticalAlign: "middle", marginRight: "5px" }}
            />
            Profile Page
          </Link>
        }
      />
      <Tab
        eventKey="/contact"
        title={
          <Link
            to="/contact"
            className={`tab-link ${
              location.pathname === "/contact" ? "active" : ""
            }`}
          >
            <CalendarTodayOutlinedIcon
              style={{ verticalAlign: "middle", marginRight: "5px" }}
            />
            Status Tracker
          </Link>
        }
      />
    </Tabs>
  );
};

const Topbar = () => {
  return (
    <Router>
      <TopbarTabs location={window.location} />

      <Routes>
        <Route path="/home" element={<h1>Home</h1>} />
        <Route path="/profile" element={<div>Profile content here</div>} />
        <Route
          path="/contact"
          element={<div>Contact/Status tracker content here</div>}
        />
      </Routes>
    </Router>
  );
};

export default Topbar;
